import { action, observable } from "mobx";

export default new (class RouteStore {
  /** Router History */
  @observable history = null;
  /** Set Router History */
  @action setHistory(history) {
    this.history = history;
  }
  /** Go History Back */
  @action goBack(number) {
    this.history.goBack(number || 1);
  }
})();
